import * as a from './StyledHeader.js';

function Header() {
  return (
    <a.HeaderBox>
        <a.HeaderWrap>
            <a.Logo src={require('../../images/LogoWhite.png')}/>
            <a.SearchBox/>
            <a.SearchSimbol src={require('../../images/searchSimbol.png')}/>
        </a.HeaderWrap>
        <a.NavWrap>
            <a.LoginBtn>로그인</a.LoginBtn>
            <a.Mypage></a.Mypage>
            <a.MealSharePage></a.MealSharePage>
        </a.NavWrap>
    </a.HeaderBox>
  );
}

export default Header;
